import products from "../products.json"

function ShoppingCart() {
    const product = products.cart.item[0]
    console.log(product);
    fetch('https://github.com/ChrisMoura2000/challenge-front/blob/master/products.json').then((response) => console.log(response))
    return (
        <div>
            <img src="../images/products/note01-samsung-160-160.jpg" alt="" />
            <p>{product.name}</p>
            <p>Qtd.: {product.quantity}</p>
            <p>{product.bestPriceFormated}</p>
        </div>
    )
}

export default ShoppingCart;
